import React, { useEffect, useState } from 'react';
import fetchData from '../http-requests';

function RecipeList() {

  const [recipes, setRecipes] = useState(null);

  useEffect(() => {
    fetchData('pizza')
    .then(data => {
        setRecipes(data);
    })
    .catch(err => console.log(err))
  }, [])

  return (
    <div className="App">
      <p>{recipes}</p>
    </div>
  );
}

export default RecipeList;
